import React, { Component } from 'react';

import 'bootstrap/dist/css/bootstrap.min.css';




class PageListagem extends Component {

  

  render() {
    return (
      <>
      <ul className="list-group">

        {this.props.pessoas.map((pessoa, index) => {

          return (
            <li align="center" className="list-group-item" key={index}>
              {index + " =>" + " Email: " + pessoa.email + " Senha: " + `${pessoa.senha}`}
            </li>
          )

        })}

      </ul>


      <table class="table">
          <thead class="thead-dark">
            <tr>
              <th scope="col">Nome</th>
              <th scope="col">Email</th>
              <th scope="col">Estado</th>
            </tr>
          </thead>
          <tbody>
            {this.props.pessoas.map((pessoa, index) => {
              return (
                  <tr align="center" className="list-group-item" key={index}>
                    <th scope="row">index</th>
                    <td>pessoa.email</td>
                    <td>pessoa.senha</td>
                    <td>pessoa.estado</td>
                  </tr>
              )
            })}
          </tbody>
        </table>



  
      
      </>


    )
  }
}

export default PageListagem;
